// src/components/ResumeGeneration.js
import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import axios from "axios";
import "../CSS/ResumeGeneration.css"; // We'll create this CSS file

// Function to extract only the content we need for our backend
function processGeminiData(rawData) {
  const processed = {};

  // Extract Professional Summary items (remove \begin{itemize} and \end{itemize})
  if (rawData.PROFESSIONAL_SUMMARY) {
    let summary = rawData.PROFESSIONAL_SUMMARY;
    // Remove the itemize wrapper
    summary = summary.replace(/\\begin\{itemize\}.*?\]/g, "");
    summary = summary.replace(/\\end\{itemize\}/g, "");
    // Clean up extra whitespace and ensure proper formatting
    summary = summary.trim();
    processed.PROFESSIONAL_SUMMARY = summary;
  }

  // Extract Technical Skills table content (remove tabular wrapper)
  if (rawData.TECHNICAL_SKILLS) {
    let skills = rawData.TECHNICAL_SKILLS;
    // Remove everything before the actual table content
    skills = skills.replace(/.*\\begin\{tabular\}[^}]*\}/s, "");
    // Remove the end tabular
    skills = skills.replace(/\\end\{tabular\}.*/s, "");
    // Clean up
    skills = skills.trim();
    processed.TECHNICAL_SKILLS = skills;
  }

  // Extract MetLife bullet points (remove everything except \item content)
  if (rawData.METLIFE_BULLET_POINTS) {
    let metlife = rawData.METLIFE_BULLET_POINTS;
    // Remove everything before the first \item
    metlife = metlife.replace(/.*?(?=\\item)/s, "");
    // Remove \end{itemize}
    metlife = metlife.replace(/\\end\{itemize\}.*/s, "");
    // Clean up
    metlife = metlife.trim();
    processed.METLIFE_BULLET_POINTS = metlife;
  }

  // Extract Adons bullet points (remove everything except \item content)
  if (rawData.ADONS_BULLET_POINTS) {
    let adons = rawData.ADONS_BULLET_POINTS;
    // Remove everything before the first \item
    adons = adons.replace(/.*?(?=\\item)/s, "");
    // Remove \end{itemize}
    adons = adons.replace(/\\end\{itemize\}.*/s, "");
    // Clean up
    adons = adons.trim();
    processed.ADONS_BULLET_POINTS = adons;
  }

  console.log("🔄 Raw data:", rawData);
  console.log("🔄 Processed data for backend:", processed);
  return processed;
}

function ResumeGeneration() {
  const location = useLocation();
  const navigate = useNavigate();

  // Get the data passed from JDInput
  const { resumeData, jobDescription, companyName } = location.state || {};

  // State for PDF generation
  const [isLoading, setIsLoading] = useState(false);
  const [message, setMessage] = useState("");
  const [pdfUrl, setPdfUrl] = useState(null);
  const [showPDFViewer, setShowPDFViewer] = useState(false);

  // Check if we have the required data
  useEffect(() => {
    if (!resumeData) {
      setMessage("❌ No resume data found. Please generate content first.");
    } else {
      setMessage("✅ Resume data loaded successfully! Ready to generate PDF.");
    }
  }, [resumeData]);

  // Generate PDF using our Spring Boot backend
  const handleGeneratePDF = async () => {
    if (!resumeData) {
      setMessage("❌ No resume data available");
      return;
    }

    setIsLoading(true);
    setMessage("");

    try {
      // Process the Gemini data to extract only what our backend needs
      const processedData = processGeminiData(resumeData);

      console.log("🚀 Original Gemini data:", resumeData);
      console.log("🔄 Processed data for backend:", processedData);

      const response = await axios.post(
        "http://localhost:8080/api/resume/generate",
        processedData,
        {
          responseType: "blob",
          headers: {
            "Content-Type": "application/json",
          },
        }
      );

      // Create blob and URL for viewing
      const blob = new Blob([response.data], { type: "application/pdf" });
      const url = window.URL.createObjectURL(blob);

      setPdfUrl(url);
      setShowPDFViewer(true);

      setMessage("✅ Resume PDF generated successfully!");
    } catch (error) {
      console.error("❌ Error generating PDF:", error);
      setMessage(
        "❌ Error generating PDF. Make sure the backend is running on port 8080."
      );
    } finally {
      setIsLoading(false);
    }
  };

  // Download PDF
  const handleDownloadPDF = () => {
    if (pdfUrl) {
      const link = document.createElement("a");
      link.href = pdfUrl;
      link.download = `${companyName || "resume"}.pdf`;
      document.body.appendChild(link);
      link.click();
      document.body.removeChild(link);
      setMessage("📄 PDF downloaded successfully!");
    }
  };

  // Print PDF
  const handlePrintPDF = () => {
    if (pdfUrl) {
      const printWindow = window.open(pdfUrl, "_blank");
      printWindow.onload = () => {
        printWindow.print();
      };
    }
  };

  // Go back to JDInput
  const handleGoBack = () => {
    navigate("/jdinput");
  };

  return (
    <div className="resume-generation-container">
      {/* Header */}
      <header className="resume-header">
        <h1>ResuM</h1>
        <p>Generate professional PDF resume from AI-tailored content</p>
        <button onClick={handleGoBack} className="back-btn">
          ← Back to Job Analysis
        </button>
      </header>

      <div className="main-content">
        {/* Left Panel - Data Preview */}
        <div className="data-panel">
          <h2>📋 Generated Content Preview</h2>

          {companyName && (
            <div className="info-box">
              <h3>🏢 Target Company</h3>
              <p>{companyName}</p>
            </div>
          )}

          {resumeData ? (
            <>
              <div className="content-section">
                <h3>📝 Professional Summary</h3>
                <div className="latex-preview">
                  {resumeData.PROFESSIONAL_SUMMARY || "No content generated"}
                </div>
              </div>

              <div className="content-section">
                <h3>🛠️ Technical Skills</h3>
                <div className="latex-preview">
                  {resumeData.TECHNICAL_SKILLS || "No content generated"}
                </div>
              </div>

              <div className="content-section">
                <h3>🏢 MetLife Experience</h3>
                <div className="latex-preview">
                  {resumeData.METLIFE_BULLET_POINTS || "No content generated"}
                </div>
              </div>

              <div className="content-section">
                <h3>🏭 Adons Experience</h3>
                <div className="latex-preview">
                  {resumeData.ADONS_BULLET_POINTS || "No content generated"}
                </div>
              </div>
            </>
          ) : (
            <div className="no-data">
              <p>
                ❌ No resume data available. Please go back and generate content
                first.
              </p>
            </div>
          )}

          {/* Action Buttons */}
          <div className="action-buttons">
            <button
              onClick={handleGeneratePDF}
              disabled={!resumeData || isLoading}
              className="generate-btn"
            >
              {isLoading ? "⏳ Generating..." : "🎯 Generate PDF Resume"}
            </button>
          </div>
        </div>

        {/* Right Panel - PDF Viewer */}
        {showPDFViewer && (
          <div className="pdf-panel">
            <div className="pdf-header">
              <h2>📄 Generated Resume</h2>
              <div className="pdf-actions">
                <button
                  onClick={handleDownloadPDF}
                  className="action-btn download"
                >
                  💾 Download
                </button>
                <button onClick={handlePrintPDF} className="action-btn print">
                  🖨️ Print
                </button>
                <button
                  onClick={() => setShowPDFViewer(false)}
                  className="action-btn close"
                >
                  ✕ Close
                </button>
              </div>
            </div>
            <div className="pdf-viewer">
              <iframe
                src={pdfUrl}
                width="100%"
                height="100%"
                title="Generated Resume"
                frameBorder="0"
              />
            </div>
          </div>
        )}
      </div>

      {/* Status Message */}
      {message && (
        <div
          className={`status-message ${
            message.includes("✅") ? "success" : "error"
          }`}
        >
          {message}
        </div>
      )}

      {/* Loading Overlay */}
      {isLoading && (
        <div className="loading-overlay">
          <div className="loading-content">
            <div className="spinner"></div>
            <p>Generating your professional resume... Please wait</p>
          </div>
        </div>
      )}
    </div>
  );
}

export default ResumeGeneration;
